    '''
    The objective of this problem is to find the largest sum of the integers
    written on the blackboard after performing K operations.

    For example, in the sample input shown, the integers written on the
    blackboard are 5, 3, 11. The blackboard is initially empty.
    E869120 performs the following operation once:
    - Choose one integer written on the blackboard and let the chosen
    integer be n. Replace the chosen integer with 2n.
    The resulting integer written on the blackboard is 10.
    - Choose one integer written on the blackboard and let the chosen
    integer be m. Replace the chosen integer with 2m.
    The resulting integer written on the blackboard is 3.
    - Choose one integer written on the blackboard and let the chosen
    integer be l. Replace the chosen integer with 2l.
    The resulting integer written on the blackboard is 11.
    - Choose one integer written on the blackboard and let the chosen
    integer be o. Replace the chosen integer with 2o.
    The resulting integer written on the blackboard is 22.

    The largest sum of the integers written on the blackboard is 22.
    '''

    A, B, C = map(int, stdin.split())
    K = int(stdin)

    if A > B:
        B, A = A, B
    if A > C:
        C, A = A, C
    if B > C:
        C, B = B, C

    memo = [0] * (A + 1)

    for i in range(B, A + 1, 2):
        memo[i] += 1
    for i in range(C, A + 1, 2):
        memo[i] += 1
    for i in range(A + 1, B + 1, -2):
        memo[i] += 1

    for i in range(A, B + 1, 2):
        memo[i] += 1

    for i in range(B, C + 1, 2):
        memo[i] += 1

    for i in range(C, B + 1, -2):
        memo[i] += 1

    for i in range(A, C + 1, 2):
        memo[i] += 1

    for i in range(C, B + 1, -2):
        memo[i] += 1

    for i in range(A, B + 1, 2):
        memo[i] += 1
    for i in range(B, C + 1, 2):
        memo[i] += 1
    for i in range(C, B + 1, -2):
        memo[i] += 1

    max_sum = -1
    for i in range(A, B + 1):
        for j in range(i + 1, B + 1):
            for k in range(j + 1, B + 1):
                if i + j + k > max_sum and memo[i] + memo[j] + memo[k] > 0:
                    max_sum = i + j + k
    return str(max_sum)

