    Let N be the length of the string, M be the number of ones in the string and F be the number of twos.

    The conditions on the conditions for Balancing the Stones are:
    1. F - M == 1
    2. F - M == -1
    3. M - (F + 1) == 1
    4. M - (F + 1) == -1
    5. F - (M + 1) == 1
    6. F - (M + 1) == -1

    This means that there are at most three black stones and at most three white stones that can be placed.
    Thus, the algorithm runs in O(N) time and O(1) space.
    '''
    black = []
    white = []
    for c in stdin:
        if c == 'W':
            white.append(c)
        else:
            black.append(c)
    if len(white) < len(black):
        diff = len(white) - len(black)
        if diff == 1:
            white.append('W')
        elif diff == -1:
            black.append('B')
    elif len(white) > len(black):
        diff = len(black) - len(white)
        if diff == 1:
            white.append('W')
        elif diff == -1:
            black.append('B')

    return str(int(len(black) == len(white)))

