        for x, y in points:
            kill_count += 1
            if get_area(*shoot(x, y), rectangle) <= area:
                killed_flies.add(shoot(x, y))

        return kill_count, killed_flies

    rounds = play_round(picture, racket)
    while rounds[0] > max_kill:
        rounds = play_round(picture, shoot(*racket))
    return str(rounds[0])


