    char_to_lang: Dict[str, List[str]] = {}
    # maps languages to the characters that can speak them
    lang_to_char: Dict[str, List[str]] = {}
    # maps the language spoken by a character to the characters that can speak it
    lang_to_char_to_lang: Dict[str, Dict[str, List[str]]] = {}
    for i in range(N):
        char_to_lang[characters[i]] = languages[i][0]
        lang_to_char[languages[i][0]] = languages[i]
        for l in languages[i][1:]:
            if l not in lang_to_char_to_lang:
                lang_to_char_to_lang[l] = {}
            if l not in lang_to_char:
                lang_to_char[l] = []
            lang_to_char[l].append(characters[i])
            lang_to_char_to_lang[l][characters[i]] = languages[i][1:]

    # initialize the answer with all the characters
    ans = [characters[i] for i in range(N)]

    # use a set to keep track of characters that can speak a language
    characters_that_can_speak_lang: Set[str] = set()

    # iterate over each language to get a set of characters that can speak that language
    for l in lang_to_char:
        characters_that_can_speak_lang.update(lang_to_char[l])

    # iterate over each character to see if it can speak a language
    for c in char_to_lang:
        # if the character can speak that language, we can add it to the answer
        if c in characters_that_can_speak_lang:
            ans.append(c)
    return str(len(ans))

